INSERT INTO `article` (`article_id`, `article_name`, `content`, `images`, `video`, `owner`, `status`) VALUES
(1, 'เที่ยวเชียงใหม่', 'เมืองศูนย์กลางการท่องเที่ยวของภาคเหนือ เมืองแห่งศิลปะของล้านนาที่เต็มไปด้วยมนต์เสน่ห์แห่งธรรมชาติ ทั้งสายน้ำลำธาร ป่าไม้ ขุนเขา และ สถาปัตยกรรม วัดวาอาราม ที่มีความเป็นเอกลักษณ์ ผู้คนที่เคยมาต่างบอกเล่าถึงประสบการณ์อันน่าประทับใจ แล้วบอกต่อกันถึงความสวยงาม ชวนให้น่าสัมผัส จึงทำให้เชียงใหม่ยังคงเป็นเมืองที่ได้รับความนิยมจากนักท่องเที่ยวมากที่สุดในแถบจังหวัดภาคเหนือ ไม่ว่ากาลเวลาจะผ่านไปนานแค่ไหนเมืองเชียงใหม่ก็ยังคงเป็นเมืองท่องเที่ยวอันดับต้นๆของประเทศอย่างไม่เสื่อมคลาย ลมหนาวกำลังพัดมาเยือนทำให้นึกถึงสถานที่ท่องเที่ยวที่สามารถสัมผัสกับอากาศหนาวได้อย่างเต็มที่ แน่นอนว่าหลายๆ คนคงจะต้องนึกถึงเชียงใหม่เป็นสถานที่แรกๆ สำหรับใครที่วางแผนมาเที่ยวยังภาคเหนือ ลองเข้ามาเที่ยวเชียงใหม่กันดู เชื่อว่าคุณจะได้รับความประทับใจไปอย่างแน่นอน ยามมาเยือนเชียงใหม่แล้วสถานที่ท่องเที่ยวยอดฮิตมีที่ไหนกันบ้าง เชิญมาดูกันเลย', 'poster3.png', 'DG7ku_2uSoI', 5, 1),
(2, 'วัดพระธาตุดอยสุเทพราชวรวิหาร', 'เป็นวัดคู่บ้านคู่เมืองเชียงใหม่มาอย่างช้านาน เรียกได้ว่าหากใครมาเที่ยวจังหวัดเชียงใหม่แล้วไม่ขึ้นไปนมัสมารองค์พระธาตุก็เปรียบเสมือนยังมาไม่ถึงเชียงใหม่ แน่นอนว่า ในการมาวัดพระธาตุดอยสุเทพนั้น คือการเดินขึ้นไปยังบันไดพญานาค 306 ขั้น อันโด่งดัง หากใครเดินไม่ไหวก็สามารถเลือกซื้อตั๋วขึ้นกระเช้าขึ้นไปได้ ไปสู่องค์พระธาตุ เยี่ยมชม เจดีย์พระธาตุดอยสุเทพ เจดีย์สถาปัตยกรรมทรงเชียงแสน รอบตัวเจดีย์ปิดด้วยทองดีบุกเหลืองอร่าม  ใต้ฐานเจดีย์บรรจุพระบรมสารีริกธาตุขององค์สมเด็จพระสัมมาสัมพุทธเจ้า และ ถัดจากเจดีย์ไปไม่กี่ก้าว เป็นจุดชมวิวที่สามารถมองเห็นทัศนียภาพอันสวยงามของเมืองเชียงใหม่ได้แบบมุมกว้าง', '20171125_๑๗๑๑๒๕_0010.png', 'x7TlbKg9Vsk', 5, 1),
(3, 'พระตำหนักภูพิงค์ราชนิเวศน์', 'สถาปัตยกรรมทรงแบบไทย สร้างขึ้นเมื่อปี 2503 เพื่อใช้ในโอกาสที่พระบาทสมเด็จพระเจ้าอยู่หัวภูมิพลอดุลยเดชฯ สมเด็จพระจางเจ้าสิริกิตฺิ์ฯ เสด็จพระราชดำเนินแปรพระราชฐานมาประทับแรม อีกทั้งยังใช้เป็นสถานที่สำหรับรับรองพระราชอาคันตุกะในวโรกาสต่าง พระตำหนักภูพิงค์ราชนิเวศน์ ตั้งอยู่บนดอยบวกห้า เลยดอยสุเทพขึ้นมาประมาณ 2.5 กิโลเมตร มีอากาศเย็นสบายตลอดทั้งปี ห้อมล้อมไปด้วยธรรมชาติที่สวยงาม ท่ามกลางด้วยหมอกอ่อนๆ สถานที่ปกคลุมไปด้วยพรรณไม้ ดอกไม้ชนิดต่างๆ ตลอดสองทางเดินชมพระตำหนักก โดยเฉพาะดอกกุหลาบเวียงพิงค์ ดอกกุหลาบขนาดใหญ่ สวยงามบานสะพรั่งเป็นพิเศษในช่วงหน้าหนาวคอยอวดสายตาแก่ผู้มาเยือน', '9867434.php', '6tzardocIJk', 5, 0);

