(22, 0, 1, 'ศูนย์พัฒนาโครงการหลวงขุนแปะ', 'https://firebasestorage.googleapis.com/v0/b/royolproject-f9706.appspot.com/o/images%2F%E0%B8%9B%E0%B8%B1%E0%B8%87%E0%B8%84%E0%B9%88%E0%B8%B2.jpg?alt=media&token=11d6c11c-1cc3-481a-9523-fdbb7da407d9', 'ศูนย์พัฒนาโครงการหลวงขุนแปะก่อตั้งขึ้นเมื่อเดือนกุมภาพันธ์ ปี พ.ศ. 2526 ตามพระราชดำรัสของพระบาทสมเด็จพระเจ้าอยู่หัว เพื่อช่วยเหลือชาวเขาเผ่ากะเหรี่ยงและม้ง โดยสร้างอาชีพทดแทนการปลูกฝิ่น และทำไร่เลื่อนลอย มีชีวิตความเป็นอยู่ที่ดีขึ้น คลอบคลุมพื้นที่เกษตรหมู่บ้าน โดยเริ่มดำเนินการพัฒนาและส่งเสริมด้านไม้ผลเป็นอันดับแรก ต่อมาได้ขยายผลการดำเนินงานไปในด้านส่งเสริมผัก ไม้ดอกไม้ประดับ สมุนไพร และพืชไร่ ตลอดจนพัฒนาและส่งเสริมด้านเศรษฐกิจสังคมและวัฒนธรรม พร้อมทั้งได้ส่งเสริมการอนุรักษ์ทรัพยากรธรรมชาติควบคู่กันไป', 'A62KfIYjvyc', '095 450 6335', 'อุทยานแห่งชาติ ออบหลวง', '18°18\'42.6', 'ร้านขุนแปะ', 'หมีส้มโฮมสเตย์', 3),
(23, 0, 1, 'ศูนย์พัฒนาโครงการหลวงห้วยเสี้ยว', 'https://firebasestorage.googleapis.com/v0/b/royolproject-f9706.appspot.com/o/images%2F%E0%B8%AB%E0%B9%89%E0%B8%A7%E0%B8%A2%E0%B9%80%E0%B8%AA%E0%B8%B5%E0%B8%A2%E0%B8%A702.jpg?alt=media&token=8f1bda5c-0983-4dd3-bf4f-b2a7c37fb810', 'ศูนย์พัฒนาโครงการหลวงห้วยเสี้ยว ได้ก่อตั้งมาตั้งแต่ปี พ.ศ. 2522 โดยเริ่มดำเนินการพัฒนาและส่งเสริมด้านระบบอนุรักษ์ดินและน้ำและทำการส่งเสริมปลูกพืชไร่เป็นลำดับแรกต่อมาได้ทำการขยายผลการดำเนินงานไปในด้านส่งเสริมไม้ผลเขตร้อน และดำเนินการพัฒนาและส่งเสริมทั้งในด้านเศรษฐกิจ สังคมและวัฒนธรรมพร้อมทั้งได้ส่งเสริมการอนุรักษ์ทรัพยากรธรรมชาติควบคู่กันไป ปัจจุบันศูนย์พัฒนาโครงการหลวงห้วยเสี้ยวมีพื้นที่รับผิดชอบดำเนินงาน 6,000 ไร่', 'http://music.sanook.com/music/chart/46/', '02589746612', 'ไปเรื่อยๆ', '784965544875\r\n44', '0', '', 0),
(24, 0, 2, 'ศูนย์พัฒนาโครงการหลวงแม่ลาน้อย', 'https://firebasestorage.googleapis.com/v0/b/royolproject-f9706.appspot.com/o/images%2F%E0%B9%81%E0%B8%A1%E0%B9%88%E0%B8%A5%E0%B8%B2%E0%B8%99%E0%B9%89%E0%B8%AD%E0%B8%A201.jpg?alt=media&token=6b8d9b7e-26e0-43e1-9736-aab77b0ab84c', 'เนื่องจากเป็นพื้นที่ห่างไกลความเจริญการคมนาคมลำบากขาดระบบสาธารณูปโภคปี พ.ศ. 2513 พระบาทสมเด็จพระเจ้าอยู่หัว และสมเด็จพระนางเจ้าพระบรมราชินนาถเสด็จเยี่ยมราษฎรบ้านห้วยห้อมเป็นครั้งแรกและได้พระราชทานทรัพย์แก่ราษฎรที่ขาดแคลนข้าวเพื่อจัดตั้งเป็นธนาคารข้าวทรงรับสั่งว่าเป็นธนาคารข้าวแห่งแรกของโลกปี พ.ศ. 2521 เป็นจุดเริ่มต้นการพัฒนาพื้นที่โดยพระบาทสมเด็จพระเจ้าอยู่หัวได้เสด็จเป็นการส่วนพระองค์ จึงมีกระแสรับสั่งให้ส่วนราชการมาพัฒนาพื้นที่ เพื่อกำหนดแผนพัฒนาชาวเขาปี พ.ศ. 2523 ศูนย์พัฒนาโครงการหลวงแม่ลาน้อยได้ก่อตั้งขึ้นอย่างเป็นทางการ', 'https://www.youtube.com/embed/-tldcpFO6ds\" frameborder=\"0\" allow=\"autoplay; encrypted-media', '0231645497', '-', '41232.564258762587', '-', '-', 0),
(25, 0, 1, 'ศูนย์พัฒนาโครงการหลวงแม่สะป๊อก', 'https://firebasestorage.googleapis.com/v0/b/royolproject-f9706.appspot.com/o/images%2F%E0%B9%81%E0%B8%A1%E0%B9%88%E0%B8%AA%E0%B8%B0%E0%B8%9B%E0%B9%87%E0%B8%AD%E0%B8%8102.jpg?alt=media&token=221c9080-dc6d-49d3-8ffc-4b785546eea8', 'ศูนย์พัฒนาโครงการหลวงแม่สะป๊อกตั้งอยู่ที่บ้านแม่สะป๊อก หมู่ 5 ตำบลแม่วิน อำเภอแม่วาง จังหวัดเชียงใหม่ ก่อตั้งเมื่อ พ.ศ. 2526 เพื่อต้องการสร้างความเป็นอยู่ที่ดีขึ้นให้กับราษฎรในพื้นที่ การวิจัยพืชเกษตรหลักที่สามารถสร้างรายได้ให้เพียงพอแก่การเลี้ยงชีพ เพื่อหลีกการปลูกฝิ่นอีกทั้งปลูกฝั่งให้เกิดจิตสำนึกอนุรักษ์ป่าอันเป็นต้นกำเนิดของแหล่งน้ำครอบคลุม 4 หมู่บ้าน', 'https://www.youtube.com/watch?v=cus92pggMhY', '02589746612', '-', '326.66843163.649', '-', '-', 0),
(26, 0, 1, 'ศูนย์พัฒนาโครงการหลวงหนองหอย', 'https://firebasestorage.googleapis.com/v0/b/royolproject-f9706.appspot.com/o/images%2F%E0%B8%AB%E0%B8%99%E0%B8%AD%E0%B8%87%E0%B9%80%E0%B8%82%E0%B8%B5%E0%B8%A2%E0%B8%A7.jpg?alt=media&token=fa617e0b-60da-474c-b89a-bc2a4ac18b9a', 'ศูนย์พัฒนาโครงการหลวงหนองหอย ก่อตั้งขึ้นเมื่อ พ.ศ.2517 ในพื้นที่อุทยาแห่งชาติดอยสุเทพ-ปุย เป็นเขตพื้นที่ลุ่มน้ำชั้นที่ 1 เป็นแหล่งกำเนิดต้นน้ำลำธารปัญหาชาวเขาได้ทำลายป่าเพื่อเปิดที่ทำกินใหม่ ปลูกฝิ่นทำไร่เลื่อนลอย จึงตั้งเป็นศูนย์พัฒนาโครงการหลวงหนองหอยขึ้น เพื่อส่งเสริมและพัฒนาอาชีพของเกษตรกร โดยแนะนำพืชเศรษฐกิจใหม่ๆทดแทนการปลูกฝิ่นทำไร่เลื่อนลอย ยกระดับความเป็นอยู่ของชาวเขาให้ดีขึ้น', '', '', '', '', '0', '', 0),
(27, 0, 1, 'ศูนย์พัฒนาโครงการหลวงปังค่า', 'https://firebasestorage.googleapis.com/v0/b/royolproject-f9706.appspot.com/o/images%2F%E0%B8%9B%E0%B8%B1%E0%B8%87%E0%B8%84%E0%B9%88%E0%B8%B2.jpg?alt=media&token=11d6c11c-1cc3-481a-9523-fdbb7da407d9', 'ศูนย์พัฒนาโครงการหลวงหนองหอย ก่อตั้งขึ้นเมื่อ พ.ศ.2517 ในพื้นที่อุทยาแห่งชาติดอยสุเทพ - ปุย เป็นเขตพื้นที่ลุ่มน้ำชั้นที่ 1 เป็นแหล่งกำเนิดต้นน้ำลำธารปัญหาชาวเขาได้ทำลายป่าเพื่อเปิดที่ทำกินใหม่ ปลูกฝิ่นทำไร่เลื่อนลอย จึงตั้งเป็นศูนย์พัฒนาโครงการหลวงหนองหอยขึ้น เพื่อส่งเสริมและพัฒนาอาชีพของเกษตรกร โดยแนะนำพืชเศรษฐกิจใหม่ๆ ทดแทนการปลูกฝิ่นทำไร่เลื่อนลอย ยกระดับความเป็นอยู่ของชาวเขาให้ดีขึ้น', '', '', '', '', '0', '', 0),
(28, 0, 1, 'ศูนย์พัฒนาโครงการหลวงม่อนเงาะ', 'https://firebasestorage.googleapis.com/v0/b/royolproject-f9706.appspot.com/o/images%2F%E0%B8%AB%E0%B8%A1%E0%B9%88%E0%B8%AD%E0%B8%99%E0%B9%80%E0%B8%87%E0%B8%B2%E0%B8%B0.jpg?alt=media&token=80ef1e26-a2b1-40e1-9c70-4ccd998f70d1', 'ศูนย์พัฒนาโครงการหลวงม่อนเงาะ ก่อตั้งเมื่อ ปีพ.ศ.2528 หม่อมเจ้าภีศเดช รัชนี องค์ประธานมูลนิธิโครงการหลวงได้มีรับสั่งให้เจ้าหน้าที่เดินทางไปสำรวจสภาพพื้นที่หมู่บ้านม่อนเงาะ ตำบลเมืองก๋าย อำเภอแม่แตง จังหวัดเชียงใหม่ ซึ่งมีชาวไทยภูเขาเผ่าม้งอาศัยอยู่ในพื้นที่ และได้ตัดไม้ทำลายป่าเพื่อทำไร่เลื่อนลอยด้วยการปลูกฝิ่น และพืชไร่ทุกปี มีสภาพความเป็นอยู่ที่ยากจน เพื่อประกอบการพิจารณา ในการวางแผนพัฒนาให้สอดคล้องกับความต้องการของชาวเขา และศูนย์พัฒนาโครงการหลวงม่อนเงาะจึงเริ่มดำเนินการตั้งแต่บัดนั้นเป็นต้นมา โดยเริ่มดำเนินการพัฒนาและส่งเสริมด้านพืชผักเป็นลำดับแรก ต่อมาได้ทำการขยายผลการดำเนินงานไปในด้านพัฒนาสังคมและกิจกรรมกลุ่ม จนสามารถดำเนินการพัฒนาและส่งเสริมทั้งในด้านเศรษฐกิจ สังคม และวัฒนธรรม พร้อมทั้งได้ส่งเสริมการอนุรักษ์ทรัพยากรธรรมชาติควบคู่กันไป', '', '', '', '', '0', '', 0),
(29, 0, 1, 'ศูนย์พัฒนาโครงการหลวงอ่างขาง', 'https://firebasestorage.googleapis.com/v0/b/royolproject-f9706.appspot.com/o/images%2F%E0%B8%AD%E0%B9%88%E0%B8%B2%E0%B8%87%E0%B8%82%E0%B9%88%E0%B8%B2%E0%B8%87.jpg?alt=media&token=e0499e96-e1fc-4b8f-9861-1ec8bb482187', 'ศูนย์พัฒนาโครงการหลวงอ่างขางได้ก่อตั้งมาตั้งแต่ปี พ.ศ.2524 โดยเริ่มดำเนินการพัฒนาและส่งเสริมอาชีพด้านพืชผัก ไม้ดอก ไม้ผล และพืชเครื่องดื่มเมืองหนาวเป็นลำดับแรก ต่อมาได้ทำการขยายผลการดำเนินงานไปในด้านหัตถกรรม จนสามารถดำเนินการพัฒนาและส่งเสริมทั้งในด้านเศรษฐกิจ สังคม และวัฒนธรรม พร้อมทั้งได้ส่งเสริมการอนุรักษ์ทรัพยากรธรรมชาติควบคู่กันไป ปัจจุบันศูนย์พัฒนาโครงการหลวงอ่างขาง มีพื้นที่รับผิดชอบดำเนินงาน 16,577 ไร่ (26.525 ตร.ม.) ครอบคลุมพื้นที่ส่งเสริมหลัก 5 หมู่บ้าน ได้แก่ บ้านนอแล บ้านขอบด้ง บ้านปางม้า บ้านคุ้ม และบ้านหลวง', '', '', '', '', '0', '', 0),
(30, 0, 1, 'ศูนย์พัฒนาโครงการหลวงปางดะ', 'https://firebasestorage.googleapis.com/v0/b/royolproject-f9706.appspot.com/o/images%2F%E0%B8%9B%E0%B8%B2%E0%B8%87%E0%B8%94%E0%B8%B0.jpg?alt=media&token=754cce60-153b-4e13-b073-52a3033e4b4b', 'หลังจากมูลนิธิโครงการหลวงได้ดำเนินงานวิจัยเพื่อหาพันธุ์พืชที่เหมาะสม เพื่อปลูกทดแทนฝิ่น และสนองความต้องการของตลาดได้แล้ว งานสำคัญต่อมาก็คือ การขยายพันธุ์พืชชนิดต่างๆ ให้จำนวนพอเพียงสำหรับงานส่งเสริม จากการทดลองในระยะแรกพบว่ามีไม้ผลหลายชนิดจะขยายพันธุ์ได้ดี ซึ่งสามารถกระทำได้เกือบตลอดทั้งปี ในพื้นที่ที่ไม่สูงหรือต่ำจนเกินไปในปี พ.ศ. 2522 มูลนิธิโครงการหลวงได้เลือกพื้นที่ในสถานีทดลองข้าวไร่และธัญพืชเมืองหนาวสะเมิง ของกรมวิชาการเกษตร หมู่บ้านปางดะ ตำบลสะเมิงใต้ อำเภอสะเมิง จังหวัดเชียงใหม่ เป็นแหล่งทำการขยายพันธุ์พืช ต่อมาเมื่อปริมาณความต้องการด้านพันธุ์พืชเพิ่มมากขึ้น ทำให้สถานที่แห่งนี้ทำการผลิตต้นพันธุ์ได้ไม่เพียงพอ มูลนิธิโครงการหลวงจึงเลือกสถานที่แห่งใหม่ บนพื้นที่ประมาณ 25 ไร่ ติดอ่างเก็บน้ำโครงการพระราชดำริห้วยปลาก้าง ซึ่งสร้างในปี พ.ศ. 2526 ห่างจากบริเวณเดิมไม่มากนักและในปี พ.ศ. 2528 - 2529 ได้ซื้อที่ดินเพื่อขยายพื้นที่สำหรับขยายพันธุ์พืชอย่างถาวรเพิ่มขึ้นอีกประมาณ 65 ไร่ โดยดำเนินการภายใต้ชื่อ “ศูนย์ขยายพันธุ์พืชปางดะโครงการหลวง” เมื่อวันที่ 12 กุมภาพันธ์ 2530 พระบาทสมเด็จพระจ้าอยู่หัวภูมิพลอดุลยเดช เสด็จพระราชดำเนินพร้อมด้วยสมเด็จพระเทพรัตนราชสุดา สยามบรมราชกุมารี ทรงเยี่ยมศูนย์ขยายพันธุ์พืชปางดะโครงการหลวงแห่งนี้เป็นครั้งแรก โดยทอดพระเนตรกิจการงานต่างๆ ของศูนย์ฯ พร้อมกันนี้หม่อมเจ้าภีศเดชรัชนี ประธานมูลนิธิโครงการหลวง ได้ทูลขอพระราชทานชื่อใหม่ว่า “สถานีเกษตรหลวงปางดะ” ซึ่งพระบาทสมเด็จพระเจ้าอยู่หัวได้ทรงกรุณาพระราชทานให้ใช้ชื่อนี้พร้อมกับได้ขยายพื้นที่เพิ่ม ต่อมาเมื่อวันที่ 11 มีนาคม 2534 ', '', '', '', '', '0', '', 0),
(31, 0, 1, 'ศูนย์พัฒนาโครงการหลวงแม่หลอด', 'https://firebasestorage.googleapis.com/v0/b/royolproject-f9706.appspot.com/o/images%2F%E0%B9%81%E0%B8%A1%E0%B9%88%E0%B8%AB%E0%B8%A5%E0%B8%AD%E0%B8%94.jpg?alt=media&token=949ead97-b55a-4caf-8a03-eed0b437368f', 'เมื่อ พ.ศ. 2527 คณะวิจัยกรมวิชาการเกษตร มาสำรวจ แหล่งผลิตกาแฟอราบิก้า ที่บ้านแม่หลอด พบการแพร่ระบาดของโรคราสนิมอย่างรุนแรง ซึ่งเป็นอุปสรรคที่สำคัญต่อการพัฒนากาแฟอราบิก้าบนพื้นที่สูงในภาคเหนือ ประกอบกับการได้รับการสนับสนุน เงินทุนวิจัยจากกระทรวงเกษตรสหรัฐอเมริกาผ่านโครงการหลวง จึงได้นำเอากาแฟพันธุ์อราบิก้าลูกผสมชั่วที่ 2 จำนวน 28 สายพันธุ์ ที่เชื่อว่าต้านทานต่อโรคราสนิมมาปลูก เพื่อศึกษาวิจัยและนำต้นที่แสดงความต้านทานจากห้องปฏิบัติการกระจายออกไปปลูกในพื้นที่ต่างๆ ขณะเดียวกันก็ศึกษาเกี่ยวกับแมลงศัตรูกาแฟและ การเขตกรรมไปด้วย จนสิ้นสุดความช่วยเหลือจึงนำเรื่องกราบทูลเสนอ หม่อมเจ้าภีศเดช รัชนี ซึ่งได้โปรดรับไว้ในความดูแลของโครงการหลวง และให้เป็นสถานีวิจัยหนึ่งในสี่สถานีของโครงการหลวง ตั้งแต่ปี พ.ศ.2527 จนถึงปัจจุบัน และสายพันธุ์กาแฟจากสถานีฯ ได้แพร่หลาย ออกไปในพื้นที่สูงของภาคเหนือ', '', '', '', '', '0', '', 0),
(32, 0, 1, 'ศูนย์พัฒนาโครงการหลวงแกน้อย', 'https://firebasestorage.googleapis.com/v0/b/royolproject-f9706.appspot.com/o/images%2F%E0%B9%81%E0%B8%81%E0%B8%99%E0%B9%89%E0%B8%AD%E0%B8%A2.jpg?alt=media&token=015fa1c6-8ddf-4bd3-8e43-e206af298fbd', 'พระบาทสมเด็จพระเจ้าอยู่หัวและสมเด็จพระนางเจ้าพระบรมราชินีนาถเสด็จฯเยี่ยมราษฎรชาวเขาเผ่ามูเซอ บ้านแกน้อย ต.เมืองนะ อ.เชียงดาว จ.เชียงใหม่ เมื่อวันที่ 27 กุมภาพันธ์ พ.ศ. 2523 ทรงทราบถึงปัญหาของราษฎรซึ่งคล้ายคลึงกับหมู่บ้านชาวเขาอื่นๆ ทางภาคเหนือของประเทศ มีรายได้ส่วนใหญ่จากการปลูกฝิ่นและสามารถปลูกข้าวไร่ได้เพียงปีละครั้ง พื้นที่เพาะปลูกเริ่มให้ผลผลิตต่ำ เนื่องจากปลูกพืชซ้ำที่เดิมมาเป็นระยะเวลาหลายปีติดต่อกันโดยมิได้บำรุงดินและมีการชะล้างพังทลายของดิน ประกอบกับพื้นที่บริเวณนี้มีความลาดเทไม่สูงชันมากนักและมีแหล่งน้ำที่สามารถจะทำการพัฒนาขึ้นเพื่อใช้ในการอุปโภคและบริโภคในหมู่บ้าน และใช้ประโยชน์เพื่อทำการเกษตร ปลูกพืชที่เหมาะสมกับสภาพแวดล้อมเพื่อเป็นรายได้ จึงทรงมีพระราชดำริที่จะช่วยเหลือราษฎรเหล่านี้ต่อมาเดือน มีนาคม พ.ศ. 2523 หม่อมเจ้าภีศเดช รัชนี ขณะนั้นดำรงตำแหน่งผู้อำนวยการโครงการหลวงจึงได้มอบหมายให้นายจิตติ ปิ่นทอง และคณะอาจารย์จากคณะเกษตรศาสตร์ มหาวิทยาลัยเชียงใหม่ รับสนองพระราชดำริดำเนินงานในโครงการหลวงแกน้อยขึ้น งบประมาณดำเนินการได้รับพระราชทานจากพระราชทรัพย์ส่วนพระองค์ตลอดมา และระหว่างปี พ.ศ. 2523 - 2523 โครงการได้รับการสนับสนุนในด้านการส่งเสริมการเกษตรที่สูงสมทบจากกระทรวงเกษตรสหรัฐอเมริกาช่วงปี พ.ศ. 2526 เป็นต้นมา กรมส่งเสริมการเกษตร โดยสำนักงานเกษตรจังหวัดเชียงใหม่ ได้ช่วยสนับสนุนบุคลากรและงบประมาณบางส่วนด้านการส่งเสริมการเกษตรเพิ่มเติมปัจจุบันงบประมาณบางส่วนได้รับจากมูลนิธิโครงการหลวงและสำนักงานปลัดกระทรวงเกษตรและสหกรณ์ได้สนับสนุนปัจจัยการผลิตในงานทดสอบ – สาธิตบางส่วน', '', '', '', '', '0', '', 0),
(33, 0, 1, 'ศูนย์พัฒนาโครงการหลวงห้วยลึก', 'https://firebasestorage.googleapis.com/v0/b/royolproject-f9706.appspot.com/o/images%2F%E0%B8%AB%E0%B9%89%E0%B8%A7%E0%B8%A2%E0%B8%A5%E0%B8%B6%E0%B8%81.jpg?alt=media&token=117b85d6-7ac1-41cf-9d1a-6a0900682025', 'เมื่อเดือนมีนาคมพ.ศ. 2521 ชาวเขาเผ่าม้งได้อพยพจากบ้านบ่อเหล็ก อำเภอจอมทอง จังหวัดเชียงใหม่ มาอยู่ที่บ้านห้วยลึก เนื่องจากพื้นที่ทำกินเดิมไม่เหมาะสมแก่การเพาะปลูกและยื่นฏีกาถวายต่อพระบาทสมเด็จพระเจ้าอยู่หัว เพื่อขอพระราชทานที่ดินทำกินปี 2522 พระบาทสมเด็จพระเจ้าอยู่หัวได้ทรงมีรับสั่งให้ หม่อมเจ้าภีศเดช รัชนี เข้าไปช่วยเหลือชาวเขา ด้วยทรงเกรงว่าชาวเขาจะบุกรุกป่าและต้นน้ำลำธารมากยิ่งขึ้น จึงได้ร่วมกับกรมป่าไม้พิจารณาพื้นที่ทำกินที่บ้านห้วยลึก ให้แก่ราษฎรชาวเขา เหตุผลของการเลือกพื้นที่บ้านห้วยลึก ก็เพราะเป็นแหล่งพื้นที่ป่าเสื่อมโทรมที่ถูกบุกรุกตัดไม้ไปจนหมดป่า หลังจากนั้นก็ได้มีชาวเขาเผ่าม้งจากบ้านป่าเกี๊ยะ อำเภอเชียงดาว และจากจังหวัดแม่ฮ่องสอน อพยพเข้ามาสมทบ ส่วนกะเหรี่ยงนั้นอาศัยอยู่บนพื้นที่อยู่แล้ว', 'https://www.youtube.com/watch?v=cus92pggMhY', '-', '-', '-', '-', '-', 0),
(34, 0, 1, 'ศูนย์พัฒนาโครงการหลวงหนองเขียว', 'https://firebasestorage.googleapis.com/v0/b/royolproject-f9706.appspot.com/o/images%2F%E0%B8%AB%E0%B8%99%E0%B8%AD%E0%B8%87%E0%B9%80%E0%B8%82%E0%B8%B5%E0%B8%A2%E0%B8%A7.jpg?alt=media&token=fa617e0b-60da-474c-b89a-bc2a4ac18b9a', 'พระบาทสมเด็จพระเจ้าอยู่หัวฯ ได้เสด็จพระราชดำเนินมาเยี่ยมราษฎรชาวเขาในพื้นที่บ้านใหม่สามัคคีเมื่อปี พ.ศ. 2523 และทรงพระกรุณารับหมู่บ้านแห่งนี้ไว้ในการดูแลของโครงการหลวง ต่อมาได้จัดตั้งเป็นศูนย์พัฒนาโครงการหลวงขึ้น เพื่อช่วยเหลือชีวิตความเป็นอยู่ของชาวชาวไทยภูเขาในพื้นที่ โดยมีหมู่บ้านที่รับผิดชอบคือ หมู่บ้านหนองเขียว หมู่บ้านใหม่สามัคคีอาข่าและคะฉิ่น หมู่ที่ 14 ตำบลเมืองนะ อำเภอเชียงดาว จังหวัดเชียงใหม่ เพื่อทำตามแนวพระราชดำริของพระบาทสมเด็จพระเจ้าอยู่หัว ที่ทรงห่วงใยราษฎรในพื้นที่ เนื่องจากชาวเขาเหล่านี้ต่างดำรงชีวิตอยู่อย่างแร้นแค้นและยากจน อีกทั้งเรื่องของสุขภาพอนามัยทรุดโทรมขาดการดูแลเอาใจใส่ เด็กเล็กๆ ส่วนใหญ่ต้องเป็นโรคขาดสารอาหาร ศูนย์พัฒนาโครงการหลวงหนองเขียว ได้เริ่มต้นดำเนินงานพัฒนาคุณภาพชีวิตของชาวเขาเหล่านี้และด้วยความร่วมมือจาก สำนักงานป่าไม้เขตจังหวัดเชียงใหม่ กรมพัฒนาที่ดินเข้าดำเนินการทำไม้เศรษฐกิจ และไม้ฟืน บุกเบิกพัฒนาพื้นที่และจัดสรรที่ดินทำกินให้แก่ราษฎร เพื่อทำการเกษตรอย่างถูกต้องเหมาะสมต่อไป', '', '', '', '', '0', '', 0),
(35, 0, 1, 'ศูนย์พัฒนาโครงการหลวงแม่สาใหม่', 'https://firebasestorage.googleapis.com/v0/b/royolproject-f9706.appspot.com/o/images%2F%E0%B9%81%E0%B8%A1%E0%B9%88%E0%B8%AA%E0%B8%B2%E0%B9%83%E0%B8%AB%E0%B8%A1%E0%B9%88.jpg?alt=media&token=df6c06a8-5b32-4519-8d3c-64a266df6452', 'เมื่อปี พ.ศ. 2512 พระบาทสมเด็จพระเจ้าอยู่หัว ทรงเฮลิคอปเตอร์พระที่นั่งเสด็จลงบนไร่ฝิ่นที่กำลังออกดอกบานสะพรั่ง และเสด็จพระราชดำเนินถึงหมู่บ้านชาวเขาเผ่าม้งแม่สาใหม่ และทรงงานเป็นเวลา 2 ชั่วโมง พระองค์ทรงทอดพระเนตรเห็นสุกรซึ่งเป็นสัตว์เลี้ยงที่สำคัญต่อการดำรงชีพ ตามวิถีชิวิตและพิธีกรรมของชาวเขาซึ่งมีขนาดเล็ก พุงลากดิน จึงได้ทรงพระราชทานลูกสุกรตัวผู้พันธุ์ดี จำนวน 2 ตัว พร้อมพันธุ์พืชอาหารสัตว์เพื่อเพาะปลูก ต่อมาเมื่อปี พ.ศ.2517 ศูนย์พัฒนาโครงการหลวงแม่สาใหม่ได้เริ่มต้นดำเนินงานโดยร่วมกับสถาบันเทคโนโลยีการเกษตรแม่โจ้ (มหาวิทยาลัยแม่โจ้) ดำเนินการทดลองวิจัยและผลิตเมล็ดพันธุ์พืชผักเมืองหนาวขึ้น และต่อมาในปี พ.ศ.2525 ได้ส่งเสริมอาชีพให้แก่เกษตรกรชาวเขาให้มีรายได้เพื่อทดแทนการปลูกฝิ่นจวบจนถึงปัจจุบัน', '', '', '', '', '0', '', 0),
(36, 0, 1, 'ศูนย์พัฒนาโครงการหลวงป่าเมี่ยง', '', 'ปี พ.ศ.2524 พระบาทสมเด็จพระเจ้าอยู่หัว ได้เสด็จพระราชดำเนินตรวจเยี่ยมราษฎรในพื้นที่แห่งนี้ ทรงทราบถึงความเดือดร้อน ที่อาชีพทำสวนเมี่ยงของราษฎรตกต่ำลง จึงทรงมีพระเมตตาพระราชทานค่าใช้จ่ายเป็นเงินประมาณ 300,000 บาท สำหรับกรสร้างศูนย์พัฒนาโครงการหลวงป่าเมี่ยง บนพื้นที่ 60 ไร่ ในเขตหมู่บ้านปางบง ตำบลเทพสมเด็จ อำเภอดอยสะเก็ด จังหวัดเชียงใหม่ มีหมู่บ้านในเขตความรับผิดชอบจำนวน 10 หมู่บ้าน ที่เป็นคนพื้นเมืองและชาวเขาเผ่ากะเหรี่ยง ศูนย์พัฒนาโครงการหลวงป่าเมี่ยงจัดตั้งขึ้นโดยมีวัตถุประสงค์เพื่อเป็นศูนย์สาธิตและส่งเสริมการเพาะเห็ดหอมและกาแฟแก่เกษตรกรในพื้นที่ โครงการหลวงป่าเมี่ยงได้ทำการขยายผลการดำเนินงานไปในด้านการเพาะปลูกพืชและเลี้ยงสัตว์จนสามารถดำเนินการพัฒนาและส่งเสริมทั้งในด้านเศรษฐกิจ สังคม และวัฒนธรรม พร้อมทั้งได้ส่งเสริมการอนุรักษ์ทรัพยากรธรรมชาติควบคู่กันไป ปัจจุบันศูนย์พัฒนาโครงการหลวงป่าเมี่ยง มีพื้นที่รับผิดชอบดำเนินงาน 75,506.25 ไร่ มีพื้นที่สำหรับเป็นที่อยู่อาศัย 509 ไร่ พื้นที่ทำการเกษตร 4,237 ไร่ ครอบคลุม 10 หมู่บ้าน ประชากรที่ได้รับการพัฒนาและส่งเสริมจำนวน 873 ครัวเรือน 2,249 คน', '', '', '', '', '0', '', 0),
(37, 0, 1, 'ศูนย์พัฒนาโครงการหลวงตีนตก', '', 'ศูนย์พัฒนาโครงการหลวงตีนตก ก่อตั้งขึ้นเมื่อปี พ.ศ.2524 พระบาทสมเด็จ พระเจ้าอยู่หัว ทรงพระราชทานพระราชทรัพย์ส่วนพระองค์ เพื่อเป็นค่าใช้จ่ายสำหรับก่อสร้างศูนย์ฯ ตีนตก ด้วยจำนวนเงิน 300,000 บาท เพื่อจัดตั้งให้เป็นศูนย์พัฒนาสาธิต และส่งเสริมการเพาะเห็ดหอม และการปลูกกาแฟเป็นอาชีพเสริมให้ราษฎรในพื้นที่ นอกเหนือจากการปลูกเมี่ยง พื้นที่รับผิดชอบดำเนินงาน 34.65 ตร.ม. (21,656 ไร่) เป็นพื้นที่ของศูนย์ฯ 52.1 ไร่', '', '', '', '', '0', '', 0),
(38, 0, 1, 'ศูนย์พัฒนาโครงการหลวงหลวงทุ่งหลวง', '', 'ศูนย์พัฒนาโครงการหลวงทุ่งหลวงก่อตั้งขึ้นเมื่อ พ.ศ.2522 ในเขตหมู่บ้านห้วยตอง ตำบลแม่วิน อำเภอแม่วาง จังหวัดเชียงใหม่ เพื่อดำเนินงานพัฒนาคุณภาพชีวิตชาวเขาให้มีชีวิตความเป็นอยู่ที่ดีขึ้น ตามแนวทางพระราชดำริของพระบาทสมเด็จพระเจ้าอยู่หัว โดยเริ่มดำเนินการพัฒนาและส่งเสริมด้านพืช ได้แก่ ไม้ผล ไม้ดอก และผักเป็นลำดับแรก ต่อมาได้ทำการขยายผลการดำเนินงานไปในด้านการเลี้ยงสัตว์ จนสามารถดำเนินการพัฒนาและส่งเสริมทั้งในด้านเศรษฐกิจ สังคมและวัฒนธรรม พร้อมทั้งได้ส่งเสริมการอนุรักษ์ทรัพยากรธรรมชาติควบคู่กันไป ปัจจุบันศูนย์พัฒนาโครงการหลวงทุ่งหลวงมีพื้นที่รับผิดชอบดำเนินงาน 1,460.50 ไร่ ครอบคลุม 12 หมู่บ้าน ประชากรที่ได้รับการพัฒนาและส่งเสริมจำนวน 952 ครัวเรือน 4,477 คน', '', '', '', '', '0', '', 0),
(39, 0, 1, 'ศูนย์พัฒนาโครงการหลวงแม่ทาเหนือ', '', 'ศูนย์พัฒนาโครงการหลวงแม่ทาเหนือ ตั้งอยู่ที่บ้านห้วยน้ำดิบ ตำบลทาเหนือ อำเภอแม่ออน จังหวัดเชียงใหม่ ณ บริเวณสองฟากฝั่งน้ำแม่ทา อันเป็นถิ่นอาศัยของชาวพื้นเมืองและชาวเขาเผ่ากะเหรี่ยง ซึ่งบุกรุกทำลายป่าเพื่อการเกษตรกรรม เช่น การทำนา การปลูกฟักทองและการปลูกข้าวโพดอ่อน ส่งจำหน่ายให้แก่โรงงาน เกษตรกรจึงมีรายได้ค่อนข้างต่ำ และมีสภาพความเป็นอยู่ไม่ดีเท่าที่ควร ศูนย์พัฒนาโครงการหลวงแม่ทาเหนือจึงเริ่มต้นขึ้น ในรูปโครงการหลวงพัฒนาภาคเหนือ เมื่อปี พ.ศ.2521 ตามพระราชดำริของพระบาทสมเด็จพระเจ้าอยู่หัว ที่จะช่วยเหลือราษฎรในพื้นที่ขุนแม่ทาเหนือ ให้มีความเป็นอยู่ที่ดีขึ้น โดยตั้งขึ้นบนพื้นที่ 25 ไร่ ในเขตหมู่บ้านแม่ทาเหนือ ตำบลทาเหนือ อำเภอแม่ออน จังหวัดเชียงใหม่ มีพื้นที่โครงการทั้งหมด 245 ตารางกิโลเมตร ครอบคลุมหมู่บ้านในความรับผิดชอบ 14 หมู่บ้าน โดยมีวัตถุประสงค์หลักคือ ส่งเสริมให้ชาวบ้านมีรายได้ ป้องกันไม้ให้เกิดการบุกรุกทำลายป่า', '', '', '', '', '0', '', 0),
(40, 0, 1, 'ศูนย์พัฒนาโครงการหลวงแม่แฮ', '', 'ศูนย์พัฒนาโครงการหลวงแม่แฮก่อตั้งขึ้นเมื่อ พ.ศ.2521 พระบาทสมเด็จพระเจ้าอยู่หัวทรงมีพระราชดำริให้พัฒนาอาชีพของประชากรชาวเขาหมู่บ้านแม่แฮและหมู่บ้านใกล้เคียง เพื่อพัฒนาชุมชนแบบผสมผสานบนพื้นที่สูง เพื่อยกระดับความเป็นอยู่ของชาวเขา และนำผลจากการวิจัยเกษตรที่สูงไปถ่ายทอดและส่งเสริมแก่ชาวเขา เพื่อทดแทนการปลูกฝิ่นและการทำไร่เลื่อนลอย', '', '', '', '', '0', '', 0),
(41, 0, 1, 'ศูนย์พัฒนาโครงการหลวงปางอุ๋ง', '', 'ศูนย์พัฒนาโครงการหลวงปางอุ๋ง ก่อตั้งขึ้นเมื่อ พ.ศ.2522 ที่หมู่บ้านปางอุ๋ง เป็นหมู่บ้านเก่าแก่ที่ตั้งมานานกว่า 70 ปี อยู่ในเขต ตำบลแม่ศึก อำเภอแม่แจ่ม จังหวัดเชียงใหม่ เดิมเป็นที่อยู่อาศัยของชาวเขาเผ่าม้งและกะเหรี่ยง ที่อพยพตั้งบ้านเรือนอยู่อย่างกระจัดกระจายปลูกฝิ่น ทำไร่เลื่อนลอยมานาน เมื่อวันที่ 7 มกราคม พ.ศ.2522 พระบาทสมเด็จพระเจ้าอยู่หัวเสด็จพระราชดำเนินมายังหมู่บ้านปางอุ๋ง เพื่อเยี่ยมราษฏรชาวไทยภูเขา ทรงมีพระราชดำริเรื่องชลประทานและแนะนำเรื่องอาชีพปลูกพืชชนิดใหม่เป็นรายได้ทดแทนฝิ่น ส่งเสริมให้มีการทำการเกษตรอย่างถาวรในพื้นที่ รวมทั้งการพัฒนาปัจจัยพื้นฐานให้มีมาตรฐานสังคมที่ดี โดยเริ่มดำเนินการพัฒนาและส่งเสริมด้านไม้ผลเป็นลำดับแรก ต่อมาได้ทำการขยายผลการดำเนินงานไปในด้านพืชไร่ พืชผักแปรรูป งานอนุรักษ์ทรัพยากรธรรมชาติ จนสามารถดำเนินการพัฒนาและส่งเสริมทั้งในด้านเศรษฐกิจ สังคม และวัฒนธรรม พร้อมทั้งได้ส่งเสริมการอนุรักษ์ทรัพยากรธรรมชาติควบคู่กันไป ปัจจุบันศูนย์พัฒนาโครงการหลวงปางอุ๋ง มีพื้นที่ 48,068 ไร่ ครอบคลุม 9 หมู่บ้าน 16 กลุ่มบ้าน ประชากรที่ได้รับการพัฒนาและส่งเสริมจำนวน 1,061 ครัวเรือน 5,863 คน', '', '', '', '', '0', '', 0),
(42, 0, 1, 'สถานีเกษตรหลวงปางดะ', '', 'สถานีเกษตรหลวงปางดะ เป็นสถานีวิจัยหนึ่งในสี่ของมูลนิธิโครงการหลวง เป็นศูนย์การเรียนรู้การขยายพันธุ์ไม้ผล ให้กับผู้ที่สนใจตลอดจนเป็นแหล่งศึกษาศึกษาดูงาน และฝึกงานของนักศึกษา พร้อมกับการใช้พื้นที่อย่างถูกต้องบนพื้นฐานการอนุรักษ์ทรัพยากรธรรมชาติ ระยะทางห่างจากตัวจังหวัดเชียงใหม่ ประมาณ 45 กิโลเมตร ใช้เวลาในการเดินทางประมาณ 50 ประกอบด้วย 2 ส่วน คือ\r\n- สถานีเกษตรหลวง ซึ่งดำเนินงานวิจัยและปรับปรุงพันธุ์ไม้ดอกเขตร้อน พืชผัก พืชไร่ ไม้ผลขนาดเล็ก ไม้ผลเขตหนาว ควบคู่ไปกับงานทดสอบสาธิต ส่งเสริมและพัฒนาอาชีพให้กับเกษตรกร\r\n- หน่วยวิจัยส้มโป่งน้อย ซึ่งดำเนินงานเกี่ยวกับงานวิจัยส้มปลอดโรค ทดสอบสาธิตการผลิตและงานขยายพันธุ์ เมื่อได้พันธุ์พืชที่เหมาะสมจากงานวิจัยทดสอบแล้ว งานสำคัญต่อมาของมูลนิธิโครงการหลวง ก็คือการขยายพันธุ์พืชชนิดนั้นๆ ให้มีจำนวนมากพอสำหรับการส่งเสริมในระยะแรกพบว่ามีไม้ผลเมืองหนาวหลายชนิดขยายพันธุ์ได้ดีเกือบตลอดทั้งปีบนพื้นที่ที่ไม่หนาวเย็นหรือร้อนมากเกินไป ในปี พ.ศ.2522 มูลนิธิโครงการหลวง จึงได้เลือกพื้นที่ส่วนหนึ่งของสถานีทดลองข้าวไร่และธัญพืชเมืองหนาว สะเมิง สังกัดกรมวิชาการเกษตร ', '', '', '', '', '0', '', 0),
(43, 0, 1, 'สถานีเกษตรหลวงอ่างขาง', '', 'สืบเนื่องจากพระบาทสมเด็จพระเจ้าอยู่หัวพร้อมด้วยสมเด็จพระนางเจ้าพระบรมราชินีนาถได้เสด็จพระราชดำเนินเยี่ยมราษฎรที่หมู่บ้านผักไผ่ อ.ฝาง จ.เชียงใหม่ และได้เสด็จผ่านบริเวณดอยอ่างขาง ทรงทอดพระเนตรเห็นว่าชาวเขาส่วนใหญ่ที่อาศัยอยู่บริเวณนี้ทำการปลูกฝิ่นแต่ยังยากจน ทั้งยังทำลายทรัพยากรป่าไม้ต้นน้ำลำธารที่เป็นแหล่งสำคัญต่อระบบนิเวศน์ ซึ่งจะก่อให้เกิดความเสียหายต่อส่วนอื่นของประเทศได้ จึงทรงมีพระราชดำริว่าพื้นที่นี้มีภูมิอากาศหนาวเย็น มีการปลูกฝิ่นมาก ไม่มีป่าไม้อยู่เลยและสภาพพื้นที่ไม่ลาดชันนัก ประกอบกับพระองค์ทรงทราบว่าชาวเขาได้เงินจากฝิ่นเท่ากับที่ได้จากการปลูกท้อพื้นเมือง และทรงทราบว่าที่สถานีทดลองไม้ผลเมืองหนาวของมหาวิทยาลัยเกษตรศาสตร์ได้ทดลองวิธีติดตา ต่อกิ่งกับท้อฝรั่ง จึงสละพระราชทรัพย์ส่วนพระองค์จำนวน 1,500 บาท เพื่อซื้อที่ดินและไร่จากชาวเขาในบริเวณดอยอ่างขางส่วนหนึ่ง จากนั้นจึงโปรดเกล้าฯ ตั้งโครงการหลวงขึ้นเป็นโครงการส่วนพระองค์ เมื่อ พ.ศ.2512 โดยทรงแต่งตั้งให้หม่อมเจ้าภีศเดช รัชนี เป็นผู้รับสนองพระบรมราชโองการในตำแหน่งประธานมูลนิธิโครงการหลวงใช้เป็นสถานีวิจัยและทดลองปลูกพืชเมืองหนาวชนิดต่างๆ ไม่ว่าจะเป็นไม้ผล ผัก ไม้ดอก เมืองหนาว เพื่อเป็นตัวอย่างแก่เกษตรกรชาวเขาในการนำพืชเหล่านี้มาเพาะปลูกเป็นอาชีพ ซึ่งต่อมาพระบาทสมเด็จพระเจ้าอยู่หัวฯ ได้พระราชทานนามว่า “สถานีเกษตรหลวงอ่างขาง”', '', '', '', '', '0', '', 0),
(44, 0, 1, 'สถานีเกษตรหลวงอินทนนท์', '6a731', 'สถานีเกษตรหลวงอินทนนท์ ตั้งอยู่ในพื้นที่อุทยานแห่งชาติดอยอินทนนท์ เลขที่ 202 หมู่ที่ 7 ตำบลบ้านหลวง อำเภอจอมทอง จังหวัดเชียงใหม่ ราษฎรที่อาศัยบนพื้นที่ส่วนใหญ่เป็นชาวไทยภูเขาเผ่ากะเหรี่ยงและเผ่าม้ง ซึ่งบุกรุกพื้นที่ป่าไม้ ทำไร่เลื่อนลอย ปลูกข้าวไร่ ข้าวโพด และฝิ่น ส่งผลให้ป่าที่เคยสมบูรณ์กลายสภาพเป็นป่าเสื่อมโทรม ความเป็นมาของสถานีเกษตรหลวงอินทนนท์พระบาทสมเด็จพระเจ้าอยู่หัวมีพระราชประสงค์ที่จะช่วยเหลือชาวเขาเหล่านั้นให้มีพื้นที่ทำกินเป็นหลักแหล่ง และได้รับการถ่ายทอดวิชาความรู้ทางด้านการเกษตรแผนใหม่ ปรับปรุงฐานะความเป็นอยู่ให้ดีขึ้น ด้วยการหันมาทำการเกษตรแบบถาวร อันเป็นที่มาของการจัดตั้ง “สถานีวิจัยโครงการหลวงอินทนนท์” ในปี พ.ศ. 2522 ณ บริเวณบ้านขุนกลาง เพื่อเป็นสถานีวิจัยของมูลนิธิโครงการหลวงอีกแห่งหนึ่ง ดำเนินงานวิจัยด้านไม้ดอก ไม้ประดับ พืชผัก และไม้ผล รวมทั้งถ่ายทอดผลงานวิจัยไปสู่การส่งเสริมให้เป็นรายได้ของครอบครัวเกษตรกรทั้งชาวกะเหรี่ยง และ ม้งในหมู่บ้านรอบๆ สถานีฯ พร้อมกับการพัฒนาปัจจัยพื้นฐานพัฒนาด้านสังคมและการอนุรักษ์ป่าต้นน้ำลำธารและโปรดให้เป็น “สถานีเกษตรหลวงอินทนนท์” ในปี พ.ศ. 2550', 'https://www.youtube.com/watch?v=cus92pggMhY', '0356987435', '-', '35689598431.3199652', 'ร้านสะเมา', '-', 0),
